[ { "id": "9aa1d1dc61fb47ab9b62e79303fb8922", // internal cape identifier "alias": "Minecon2013", // human-readable cape name "type": "CAPE", // "SKIN" for a skin "url": "http://textures.minecraft.net/texture/153b1a0dfcbae953cdeb6f2c2bf6bf79943239b1372780da44bcbb29273131da", // texture URL "visible": true, // is the cape visible? "profileId": "c3d8e16622234b6bb6bcccf7907fb35a", // UUID of account "textureId": "153b1a0dfcbae953cdeb6f2c2bf6bf79943239b1372780da44bcbb29273131da", // texture id "selected": true, // is the cape currently enabled on the profile? "deleted": false, // has the cape been deleted? "version": 2 // implies a v1... not sure }
] // if no capes
[] 401: Unauthorized This error occurs when you either haven't answered your security questions, or when you've passed an invalid or expired Bearer token in the Authorization header. { "error" : "UnauthorizedOperationException", "errorMessage" : "User not authenticated"
} 403: Forbidden When getting this error, you have most likely tried to view cape information tied to a UUID of a profile that is not linked to your Bearer token. { "error" : "ForbiddenOperationException", "errorMessage" : "Invalid profile id or access token."
}
